Now comes one of the most genius but strange parts of the Rijndael block cipher. This is the substitution box. A substitution block is basically a lookup table to replace (or substitute) a byte with the one from the lookup table. Some demands for such a lookup table (when used in encryption algorithms) may be: Reverseable : In order to find back the original byte, we want to be able to reverse the process. Non-Linear : In order to make resistant to linear and differential cryptanalysis, the lookup should be very difficult to approximate with a linear function. Fixed Output Sizing : In order to reduce the complexity and loss of excess data, we want to output to have a fixed bit size (preferably the same as the input). The Rijndael S-Box does all these things. Since it has all of these properties, how it specifically looks is not important. Every implementation of AES can save the Substitution-Box and its inverse in static memory since it is public knowledge. Here is the Rijndael S-Box as a python array. # Rijndael Substitution box
